Templates.template:
new sap.ushell.System(
	{
		alias: "${alias}", // string
		baseUrl: "${baseUrl}", // string
		platform: "${platform}" // string
	}
)

addCatalogTileToGroup(
	"${sCatalogTileId}", // string
	"${sGroupId}", // string
	{
		baseUrl: "${baseUrl}", // string
		remoteId: "${remoteId}" // string
	}
)

new sap.ushell.ui.appfinder.AppBox(
	"${sId}", // string
	{
		title: "${title}", // string
		url: "${url}", // string
		pinButton: ${pinButton}, // sap.m.Button
		press: [function (oEvent) {}, this], // function|array
		afterRendering: [function (oEvent) {}, this] // function|array
	}
)

new sap.ushell.ui.launchpad.LoadingDialog(
	"${sId}", // string
	{
		iconUri: ${iconUri}, // sap.ui.core.URI
		text: ${text}, // sap.ui.core.URI
		loadAnimationWithInterval: ${bLoadAnimationWithInterval} // boolean
	}
)

new sap.ushell.components.factsheet.controls.PictureTile(
	"${sId}", // string
	{
		height: ${"32px"}, // sap.ui.core.CSSSize
		width: ${"32px"}, // sap.ui.core.CSSSize
		tileContent: ${tileContent}, // (sap.ushell.components.factsheet.controls.PictureViewerItem|string)
		pictureDelete: [function (oEvent) {}, this] // function|array
	}
)

new sap.ushell.components.factsheet.controls.PictureViewer(
	"${sId}", // string
	{
		tileScaling: ${0.95}, // float
		removable: ${bRemovable}, // boolean
		items: [${items}], // sap.ushell.components.factsheet.controls.PictureViewerItem[]
		pictureDeleted: [function (oEvent) {}, this] // function|array
	}
)

new sap.ushell.components.factsheet.controls.PictureViewerItem(
	"${sId}", // string
	{
		src: "${src}", // string
		image: ${image} // sap.m.Image
	}
)
